Mongoose how to count unique days in a month?<p>i am working on a problem where in my database there supposed to be multiple entries from day to day.
each entry includes a timestamp. the problem is im supposed to find how many days in each month a data has been entered.
ex: if a user sends a message every 2 days in may. my answer would be: &quot;the user used the message function for 15 days in may&quot;.
now if the user sends 5 messages every 2 days in may. the answer would be still 15. im only counting the days the user has been using the app.</p>
<p>using this query:</p>
<pre><code>model.find({ 
    date: {
        $gte: new Date(startOfMonth), 
        $lt: new Date(endOfMonth)
    }
})
</code></pre>
<p>i was able to find all data entries on a specific month.
the data may look like something like this:</p>
<pre><code> Date: dd/mm/yy        Message:
 1/5/2022              &quot;Hello&quot;
 1/5/2022              &quot;World&quot;
 1/5/2022              &quot;!&quot;
 5/5/2022              &quot;Hello World!&quot;
 8/5/2022              &quot;Hello World!&quot;
</code></pre>
<p>the desired answer would be 3 unique days in may.</p>
<p>How do i achieve this using mongodb? the simplest answer that come to mind is to use additional queries to group by unique days, but i have no idea how to do that using mongo provided i need to access the date.</p>

