answer:
@torek I corrected _commit_ to _add_ as you said.
Regarding the gitattributes documentation (https://git-scm.com/docs/gitattributes#_effects) I quote "To control what line ending style is used in the working directory, use the eol attribute for a single file and the core.eol configuration variable for all text files." which suggests that `core.eol` is practicaly the same as `eol`.
Furthermore, and I quote again "...ensure that .vcproj files have CRLF and .sh files have LF in the working directory, ..." which refers to `*.sh text eol=lf`"

